import React, { useState } from 'react';
import { useNavigate, useLocation } from 'react-router-dom';
import injectHeaderStyles from './styles';
import type { User } from '../../../types/user';

injectHeaderStyles();

interface HeaderProps {
  subtitle?: string;
  onLogin?: () => void;
  user?: User | null;
  onLogout?: () => void;
}

export default function Header({ subtitle, onLogin, user, onLogout }: HeaderProps){
  const [searchQuery, setSearchQuery] = useState('');
  const [showSearch, setShowSearch] = useState(false);
  const navigate = useNavigate();
  const location = useLocation();

  const isManager = user?.role === 'manager';
  const isCliente = user?.role === 'cliente';

  // Menu items based on role
  const getNavItems = () => {
    if (isManager) {
      return [
        { path: '/gerenciar', label: 'üè† Painel', icon: 'üè†' },
        { path: '/criar', label: '‚ûï Criar', icon: '‚ûï' },
        { path: '/resultados', label: 'üìä Resultados', icon: 'üìä' },
        { path: '/respondentes', label: 'üë• Respondentes', icon: 'üë•' },
      ];
    } else if (isCliente) {
      return [
        { path: '/home', label: 'üè† In√≠cio', icon: 'üè†' },
        { path: '/responder', label: 'üìù Question√°rios', icon: 'üìù' },
        { path: '/meus-resultados', label: 'üìä Minhas Respostas', icon: 'üìä' },
      ];
    } else {
      return [
        { path: '/', label: 'üè† In√≠cio', icon: 'üè†' },
        { path: '/responder', label: 'üìù Question√°rios', icon: 'üìù' },
        { path: '/login', label: 'üîë Entrar', icon: 'üîë' },
      ];
    }
  };

  const navItems = getNavItems();

  return (
    <header className="sr-header">
      <div className="brand" onClick={() => navigate('/')} style={{ cursor: 'pointer' }}>
        <div className="logo" />
        <div>
          <div className="title">Question√°rios SEBRAE</div>
          {subtitle && <div className="subtitle">{subtitle}</div>}
        </div>
      </div>

      {/* Navigation */}
      <nav className="header-nav">
        {navItems.map(item => (
          <button
            key={item.path}
            className={`nav-item ${location.pathname === item.path ? 'active' : ''}`}
            onClick={() => navigate(item.path)}
          >
            <span className="nav-icon">{item.icon}</span>
            <span className="nav-label">{item.label}</span>
          </button>
        ))}
      </nav>

      <div className="header-center">
        {/* Search bar */}
        {user && (
          <div className={`search-container ${showSearch ? 'expanded' : ''}`}>
            <button 
              className="search-toggle" 
              onClick={() => setShowSearch(!showSearch)}
              title="Buscar question√°rios"
            >
              üîç
            </button>
            {showSearch && (
              <input 
                type="text" 
                placeholder="Buscar question√°rios..."
                value={searchQuery}
                onChange={(e) => setSearchQuery(e.target.value)}
                className="search-input"
                autoFocus
              />
            )}
          </div>
        )}
      </div>

      <div className="actions">
        {/* notification bell */}
        <button className="sr-bell" title="Notifica√ß√µes" aria-label="Notifica√ß√µes">üîî<span className="badge">0</span></button>
        {user ? (
          <div className="user" title="Sair" onClick={() => onLogout && onLogout()} style={{ cursor: 'pointer' }}>
            <div className="avatar" />
            <div>
              <div style={{ fontWeight: 600 }}>{user.name}</div>
              <div style={{ fontSize: 11, opacity: 0.8 }}>
                {user.role === 'manager' ? 'üëî Manager' : 'üë§ Cliente'}
              </div>
            </div>
          </div>
        ) : (
          <button className="primary" onClick={() => onLogin && onLogin()}>Entrar</button>
        )}
      </div>
    </header>
  );
}
